import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {LoginComponent} from "./mothercomponents/LoginComponent";
import {SignupComponent} from "./mothercomponents/SignupComponent";
import {CrudCategory} from "./mothercomponents/CrudCategory";
import {Settings} from "./mothercomponents/Settings";

function App() {
    const headers = [
        "ID",
        "Nom",
        "Description",
    ]
    const names = [
        "id",
        "name",
        "description",
    ]
    const rows = [
        [
            "1",
            "Informatique",
            "Tout ce qui concerne l'informatique",
        ],
        [
            "2",
            "Electronique",
            "Tout ce qui concerne l'électronique",
        ],
        [
            "3",
            "Mécanique",
            "Tout ce qui concerne la mécanique",
        ]
    ]
    const textValues=
        {
            ajouter:"Ajouter une catégorie",
            modifier:"Modifier une catégorie",
            supprimer:"Supprimer une catégorie",
            btnCreer:"Créer",
        }

  return (
      <BrowserRouter>
          <Routes>
              <Route path="/login" element={<LoginComponent/>}></Route>
              <Route path="/signup" element={<SignupComponent/>}></Route>
              <Route path="/categories" element={<CrudCategory textValues={textValues} headers={headers} names={names} rows={rows} page_description={"Gestion des catégories"}/>}></Route>
              <Route path={"/settings"} element={<Settings/>}></Route>
          </Routes>
      </BrowserRouter>
  );
}

export default App;
